export default function Athlete (name, ageCat) {
    this.name = name;
    this.ageCat = ageCat;
    this.onDeck = false;
    this.scores = [
        boulder1 = {
            score: 0,
            attempts: 0
        },
        boulder2 = {
            score: 0,
            attempts: 0
        },
        boulder3 = {
            score: 0,
            attempts: 0
        },
        boulder4 = {
            score: 0,
            attempts: 0
        },
        boulder5 = {
            score: 0,
            attempts: 0
        },
        boulder6 = {
            score: 0,
            attempts: 0
        },
        superFinal = {
            score: 0,
            attempts: 0
        },
        superFinal2 = {
            score: 0,
            attempts: 0
        },
    ];
    this.inIso = true;
    this.finalScore = 0;
    this.bouldersClimbed = 0;
    this.lastBoulder = false;
}

Athlete.prototype.cycle = function() {
    if(this.bouldersClimbed == 4) {
        this.lastBoulder == true;
        return
    }
    if(this.bouldersClimbed < 4){
        this.bouldersClimbed += 1;
    }
    this.onDeck = !this.onDeck;
}

Athlete.prototype.start = function() {
    this.inIso == false;
    this.onDeck == true;
}
